import React, { Component } from 'react';
import './table.css';

class Table extends Component {

    renderTableData()
    {
        console.log(this.props.tab);
        return this.props.tab.map((tab, index) => {
            if(tab.length > 1){
                const { row, cleanedStatus, progress } = tab; //destructuring
                return (
                    <tr key={row}>
                        <td>{row}</td>
                        <td>{cleanedStatus}</td>
                        <td>{progress}</td>
                    </tr>
                )
            }
            else
            {
                const { status } = tab; //destructuring
                return (
                    <tr key={status}>
                        <td>{status}</td>
                    </tr>
                )
            }
        })
    }

    renderTableHeader() {
        console.log(this.props.tab[0]);
        let header = Object.keys(this.props.tab[0]);
        return header.map((key, value) => {
            return (
                    <th value={value}>{key.toUpperCase()}</th>
            )
        });
        // return (
        //     <tr>
        //         <th>Row</th>
        //         <th>Clean Status</th>
        //         <th>Progress</th>
        //     </tr>
        // )
    }

    render() {
        return (
            <div>
                <h1 id='title'>Row Info</h1>
                <table id='RvZ'>
                    <tbody>
                    <tr>{this.renderTableHeader()}</tr>
                        {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Table;
